import React, { useState, useEffect } from "react";
import axios from "axios";
import "../styles/Attendees.css";

const Attendees = () => {
  const [attendees, setAttendees] = useState([]);
  const [events, setEvents] = useState([]);
  const [tasks, setTasks] = useState([]);
  const [newAttendee, setNewAttendee] = useState({ name: "", eventName: "", taskName: "" });
  const [editingAttendee, setEditingAttendee] = useState(null);

  // Fetch attendees from the server
  const fetchAttendees = async () => {
    try {
      const response = await axios.get("http://localhost:5000/api/getAttendees");
      setAttendees(response.data);
    } catch (error) {
      console.error("Error fetching attendees:", error);
    }
  };

  // Fetch events from the server
  const fetchEvents = async () => {
    try {
      const response = await axios.get("http://localhost:5000/api/getEvents");
      setEvents(response.data);
    } catch (error) {
      console.error("Error fetching events:", error);
    }
  };

  // Fetch tasks from the server
  const fetchTasks = async () => {
    try {
      const response = await axios.get("http://localhost:5000/api/getTasks");
      setTasks(response.data);
    } catch (error) {
      console.error("Error fetching tasks:", error);
    }
  };

  // Add a new attendee
  const addAttendee = async () => {
    try {
      await axios.post("http://localhost:5000/api/postAttendee", newAttendee);
      fetchAttendees();
      setNewAttendee({ name: "", event: "", task: "" });
    } catch (error) {
      console.error("Error adding attendee:", error);
    }
  };

  // Delete an attendee
  const deleteAttendee = async (name) => {
    try {
      await axios.delete("http://localhost:5000/api/deleteAttendee", {
        data: { name: name },
      });
      fetchAttendees();
    } catch (error) {
      console.error("Error deleting attendee:", error);
    }
  };

  useEffect(() => {
    fetchAttendees();
    fetchEvents();
    fetchTasks();
  }, []);

  return (
    <div className="dashboard">
      <h1>Attendees Dashboard</h1>

      <div className="add-attendee">
        <h2>Add Attendee</h2>
        <input
          type="text"
          placeholder="Attendee Name"
          value={newAttendee.name}
          onChange={(e) => setNewAttendee({ ...newAttendee, name: e.target.value })}
        />

        <select
          value={newAttendee.event}
          onChange={(e) => setNewAttendee({ ...newAttendee, event: e.target.value })}
        >
          <option value="">Select Event</option>
          {events.map((event) => (
            <option key={event._id} value={event._id}>
              {event.name}
            </option>
          ))}
        </select>

        <select
          value={newAttendee.task}
          onChange={(e) => setNewAttendee({ ...newAttendee, task: e.target.value })}
        >
          <option value="">Select Task</option>
          {tasks.map((task) => (
            <option key={task._id} value={task._id}>
              {task.name}
            </option>
          ))}
        </select>

        <button onClick={addAttendee}>Add</button>
      </div>

      <div className="attendee-list">
        <h2>Attendees List</h2>
        {attendees.map((attendee) => (
          <div key={attendee._id} className="attendee-item">
            <span>{attendee.name}</span>
            <span>{attendee.event?.name || "No Event"}</span>
            <span>{attendee.task?.name || "No Task"}</span>
            <button onClick={() => deleteAttendee(attendee.name)}>Delete</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Attendees;
